import "./App.css";
import ExpenseItem from "./Components/ExpenseItem.js";

function App() {
  const expenses = [
    {
      id: "e1",
      title: "car",
      amount: 782,
      date: "22 march 2021",
    },
    {
      id: "e2",
      title: "TV",
      amount: 222,
      date: "1 Epril 2022",
    },
    {
      id: "e3",
      title: "book",
      amount: 21,
      date: "22 march 2021",
    },
    {
      id: "e3",
      title: "book",
      amount: 21,
      date: "22 march 2021",
    },
  ];

  return (
    <div className="App">
      {
      expenses.map((expense) => <div>
        <ExpenseItem
          title={expense.title}
          amount={expense.amount}
          date={expense.date}
        />;
      </div>
      )}
    </div>
  );
}

export default App;
